import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Result.css'; // if you have styles

const Result = () => {
  const navigate = useNavigate();
  const [prediction, setPrediction] = useState(null);

  useEffect(() => {
    const storedPrediction = localStorage.getItem('prediction');
    if (storedPrediction) {
      setPrediction(JSON.parse(storedPrediction));
    } else {
      // If no prediction found, redirect back to questionnaire
      navigate('/questionnaire');
    }
  }, [navigate]);

  return (
    <div className="result-container">
      <h2>Prediction Result</h2>
      {prediction !== null ? (
        <div className="prediction-box">
          <h3>Your Depression Level Prediction:</h3>
          <p><strong>{prediction[0]}</strong></p>
        </div>
      ) : (
        <p>Loading your result...</p>
      )}
    </div>
  );
};

export default Result;
